package org.apache.commons.beanutils2;

import static org.junit.jupiter.api.Assertions.assertThrows;

import java.sql.Timestamp;

import org.junit.jupiter.api.Test;

/**
 * Tests that the timestamp conversion system rejects inputs with locale-specific formatting.
 */
public class TimestampConversionRejectionTest {

    /**
     * Validates that attempting to convert a string with grouping separators to a Timestamp
     * results in a ConversionException, as the default converters are not locale-aware.
     */
    @Test
    public void testTimestampConversionRejectsLocaleFormattedNumber() {
        // The test setup ensures a clean state by using a try-finally block to deregister
        // converters after execution, as required by the test description. The system's
        // default configuration is strict and does not handle localized number formats.
        try {
            // A numeric string with comma separators, representing an epoch timestamp.
            final String localizedEpochTimestamp = "1,672,532,400,000"; // Corresponds to Jan 1, 2023 00:00:00 UTC

            // Verify that the conversion to java.sql.Timestamp fails with a ConversionException
            // because the input string contains locale-specific numeric grouping symbols (commas),
            // which the default converter does not parse.
            assertThrows(ConversionException.class, () -> {
                ConvertUtils.convert(localizedEpochTimestamp, Timestamp.class);
            });
        } finally {
            // As per the test requirements, release conversion system resources to ensure
            // a clean state for any subsequent operations.
            ConvertUtils.deregister();
        }
    }
}

