package org.apache.commons.beanutils2;

import static org.junit.jupiter.api.Assertions.assertThrows;

import org.junit.jupiter.api.Test;

/**
 * Tests that the property access system enforces security restrictions by default,
 * preventing unauthorized navigation through sensitive object relationships.
 */
public class DefaultPropertyAccessSecurityTest {

    /**
     * A simple business entity containing an enum property for testing.
     * This bean is used as the root object for property navigation.
     */
    public static class BusinessEntity {
        private TestEnum myEnum;

        public TestEnum getMyEnum() {
            return myEnum;
        }

        public void setMyEnum(final TestEnum myEnum) {
            this.myEnum = myEnum;
        }
    }

    /**
     * Verifies that the system blocks attempts to access sensitive properties like
     * class loaders through nested property paths, enforcing default security policies.
     * This test simulates a potential vulnerability where a user might try to traverse
     * from an enum to its declaring class and then to the class loader. The default
     * configuration of PropertyUtils should prevent this.
     */
    @Test
    public void testPreventUnauthorizedNavigationToClassLoader() {
        final BusinessEntity entity = new BusinessEntity();
        entity.setMyEnum(TestEnum.A);

        // This path attempts to navigate from the enum to its declaring class, and then to the class loader.
        // By default, PropertyUtilsBean is configured with SuppressPropertiesBeanIntrospector,
        // which prevents resolution of the "declaringClass" property on enums to mitigate
        // potential security vulnerabilities.
        final String maliciousPath = "myEnum.declaringClass.classLoader";

        // We expect a NoSuchMethodException because the "declaringClass" property should not be resolved.
        // This confirms that the default security policy is in effect and blocks the traversal.
        assertThrows(NoSuchMethodException.class, () -> {
            PropertyUtils.getNestedProperty(entity, maliciousPath);
        });
    }
}

