/**
 * Validates that the property inspection utility can be configured to allow access to metadata about enumeration
 * types that would otherwise be restricted for security reasons.
 */
public class PropertyUtilsBeanEnumAccessControlTest {

    /**
     * Test bean for holding an enum value.
     */
    public static class TestRecord {
        private TestEnum enumValue = TestEnum.B;

        public TestEnum getEnumValue() {
            return enumValue;
        }

        public void setEnumValue(final TestEnum enumValue) {
            this.enumValue = enumValue;
        }
    }

    @Test
    public void testEnumClassAndClassLoaderAccessWhenSecurityIsRelaxed()
            throws IllegalAccessException, InvocationTargetException, NoSuchMethodException {
        // 1. Configure the property inspection system to remove the 'class' property restriction.
        final PropertyUtilsBean propertyUtils = new PropertyUtilsBean();
        propertyUtils.setBeanIntrospector(DefaultBeanIntrospector.INSTANCE);

        // 2. Prepare a test record with an enumeration value.
        final TestRecord record = new TestRecord();

        // 3. Retrieve the class metadata from the enumeration property.
        final Object enumClass = propertyUtils.getProperty(record, "enumValue.class");
        assertEquals(TestEnum.class, enumClass,
                "Should return the enum's Class object when security restrictions are lifted.");

        // 4. Extract the class loader from the retrieved class metadata.
        final Object classLoader = propertyUtils.getProperty(record, "enumValue.class.classLoader");
        assertNotNull(classLoader, "The class loader should be accessible.");
        assertInstanceOf(ClassLoader.class, classLoader, "The returned object should be a ClassLoader instance.");
    }
